gzF(){return"\u0414\u0430\u0436\u0435 \u043d\u0435\u0431\u043e\u043b\u044c\u0448\u043e\u0435 \u043a\u043e\u043b\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u043d\u043e\u0432\u043e\u0433\u043e \u0441\u043d\u0435\u0433\u0430, 10-15 \u0441\u043c, \u0432 \u0441\u043e\u0447\u0435\u0442\u0430\u043d\u0438\u0438 \u0441\u043e \u0448\u0442\u043e\u0440\u043c\u043e\u0432\u044b\u043c \u0432\u0435\u0442\u0440\u043e\u043c, \u043d\u0438\u0437\u043a\u043e\u0439 \u0442\u0435\u043c\u043f\u0435\u0440\u0430\u0442\u0443\u0440\u043e\u0439 \u0438 \u0441\u043b\u0430\u0431\u044b\u043c \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0435\u043c (\u0441\u043b\u043e\u0439 \u0442\u0430\u044f\u043d\u0438\u044f-\u0437\u0430\u043c\u0435\u0440\u0437\u0430\u043d\u0438\u044f, \u043f\u043e\u0432\u0435\u0440\u0445\u043d\u043e\u0441\u0442\u043d\u0430\u044f \u0438\u0437\u043c\u043e\u0440\u043e\u0437\u044c, \u043b\u0435\u0434) \u043f\u0440\u0438\u0432\u043e\u0434\u0438\u0442 \u043a \u043f\u043e\u0432\u044b\u0448\u0435\u043d\u043d\u043e\u043c\u0443 (CO) \u0443\u0440\u043e\u0432\u043d\u044e \u043e\u043f\u0430\u0441\u043d\u043e\u0441\u0442\u0438 \u0441\u0445\u043e\u0434\u0430 \u043b\u0430\u0432\u0438\u043d."},
