gzO(){return"1. \u0445\u043e\u043b\u043e\u0434\u043d\u0430\u044f \u043c\u0430\u043b\u043e\u0441\u043d\u0435\u0436\u043d\u0430\u044f \u0437\u0438\u043c\u0430 \u0438\u043b\u0438 \u043d\u0430\u0447\u0430\u043b\u043e \u0441\u0435\u0437\u043e\u043d\u0430\n2. \u0445\u043e\u043b\u043e\u0434\u043d\u044b\u0439 \u0441\u043d\u0435\u0433\u043e\u043f\u0430\u0434, \u043f\u043e\u0441\u043b\u0435 \u0434\u043b\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u043f\u0435\u0440\u0438\u043e\u0434\u0430 \u044f\u0441\u043d\u043e\u0439 \u043f\u043e\u0433\u043e\u0434\u044b\n3. \u0443\u0440\u043e\u0432\u0435\u043d\u044c \u0437\u0430\u043c\u0435\u0440\u0437\u0430\u043d\u0438\u044f \u043f\u043e\u0434\u043d\u044f\u043b\u0441\u044f \u0432\u044b\u0448\u0435 3000 \u043c\u0435\u0442\u0440\u043e\u0432 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u0437\u0430 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0434\u043d\u0435\u0439 (\u0430\u043b\u044c\u043f\u0438\u0439\u0441\u043a\u0438\u0435 \u0443\u0441\u043b\u043e\u0432\u0438\u044f)"},
